description:
Was there any movie that James Stewart couldn&amp;#039;t make better just by being in it?  Westerns are full of guitar playing cowboys.  Well here is an accordion playing, fast shooting, tough cowboy.  Great co-stars with Audie Murphey and Dan Durea.

Mr Stewart plays a trouble-shooter for the railroad that was unfairly fired but gets a chance to prove his value some years later. 

